description:
Townes is a 2009 Steve Earle album on which he pays tribute to his friend and mentor, the late singer-songwriter Townes Van Zandt by covering his songs. According to a New West Records press release, &quot;The songs selected for Townes were the ones that meant the most to Earle and the ones he personally connected to (not including selections featured on previous Earle albums).

Official Release: May 12, 2009
Rip date: Apr 22, 2009
